import { createSlice } from '@reduxjs/toolkit';

const timerSlice = createSlice({
    name: 'timer',
    initialState: {
        workInterval: 45,
        restInterval: 40,
        rounds: 3
    },
    reducers: {
        change(state, action) {
            state = action.payload
        }
    }
})

export default timerSlice.reducer
